import React from 'react';

function Widgets() {
	return (
		<div className="widgets">
			<iframe
				src="https://open.spotify.com/artist/6DARBhWbfcS9E4yJzcliqQ?si=hPq68n70Rk-EcnRxpQ-z1g"
				width="310"
				// height="1500"
				frameborder="0"
				allowtransparency="true"
				allow="encrypted-media"
				height="100%"
				style={{ border: ' none ', overflow: 'hidden' }}
			/>

			{/* <iframe
				width="340"
				height="400"
